import { Link, Route, Routes } from "react-router-dom";
import logo from './logo_white_bg'


function NavBar(){
    return (
        <>
        <nav className="bg-black">
            <div>
            </div>
            <ul className="flex flex-row justify-center items-center">
                <img className="object-scale-down h-48 w-96 flex-1" src={"./logo_white_bg.jpg"}></img>
                <li className="text-white flex-1"><Link to="/">Home</Link></li>
                <li className="text-white flex-1"><Link to="/contact">Contact</Link></li>
                <li className="text-white flex-1"><Link to="/store">Store</Link></li>
                <li className="text-white flex-1"><Link to="/cart">Cart</Link></li>
            </ul>
        </nav>
        </>
    )
}

export default NavBar;
